var divHeight = $('.dropdown-menu').height();
$('.navbar-menu > li > .dropdown-menu .submenu-main .sub-menu').css('min-height', divHeight);
$('.navbar-menu > li > .dropdown-menu .submenu-main .sub-menu > ul').css('height', divHeight - 50);
$('.navbar-menu > li > .dropdown-menu .submenu-main').css('min-height', divHeight);
$('.nav-togglebar, .body-overlay').click(function(e) {
	e.preventDefault();
	if ($('#navigation-collapse').hasClass("open")) {
		$('#navigation-collapse').removeClass("open");
		$('html, body').css('overflowY', 'auto');
		$('.body-overlay').css('opacity', '0').css('z-index', '-1');
	} else {
		$('#navigation-collapse').addClass("open");
		$('html, body').css('overflowY', 'hidden');
		$('.body-overlay').css('opacity', '1').css('z-index', '99');

	}
});
$(function () {
	$(document).scroll(function () {
		var $nav = $(".navbar-fixed-top");
		$nav.toggleClass('scrolled', $(this).scrollTop() > $nav.height());
	});
});
//close button
$('.icon-close').click(function(e) {
	e.preventDefault();
	if ($('#navigation-collapse').hasClass("open")) {
		$('.navbar-collapse').removeClass("open");
		$('html, body').css('overflowY', 'auto');
		$('.body-overlay').css('opacity', '0').css('z-index', '-1');
		$('.navbar-collapse').css('z-index', '99');
	} else {
		$('.navbar-collapse').addClass("open");
		$('.body-overlay').css('opacity', '1').css('z-index', '9');
		$('.navbar-collapse').css('z-index', '1');
	}
})
