//smooth scroll
//nav menu click with smooth scroll
$(".menu ul li a[href^='#'],.jumbotron a").on('click', function(e) {

	// prevent default anchor click behavior
	e.preventDefault();

	// store hash
	var hash = this.hash;

	// animate
	$('html, body').animate({
		scrollTop: $(hash).offset().top
	}, 1000, function(){

		// when done, add hash to url
		// (default click behaviour)
		window.location.hash = hash;
	});
});
